import './Profile.css';
import React from 'react';
import Header from '../Header/Header';
import Footer from '../Footer/Footer';

function Profile() {
  const [loggedIn] = React.useState(true);

  return (
    <section className='profile'>
      <Header loggedIn={loggedIn} />
      <Footer />
    </section>
  );
}

export default Profile;
